import React from 'react';
import { Link } from 'react-router-dom';
import Sidefilter from './sidefilter';
const products = [
	{ productid:'1', productprice:'500',sellername:'varshier',image_path:'',productname:"Oakley round sunglasses"},
	{ productid:'2', productprice:'1500',sellername:'Lenskart',image_path:'',productname:"MTV Wayfarer Spectacles"},
	{ productid:'3', productprice:'2500',sellername:'Lorem ipsum',image_path:'',productname:"Fasttrack wayfarer sunglasses"},
	{ productid:'4', productprice:'3500',sellername:'Rkumar',image_path:'',productname:"Rayban round sunglasses"},
];
function Product({ match }){
	let type=match.params.type;
	return (
		<div style={{'width':'100%','display':'flex'}}>
			<div style={{'width':'20%','height':'100vh','display':'flex'}}>
				<Sidefilter/>
			</div>
			<div style={{'width':'75%','height':'100vh','marginLeft':'5%'}}>
				{products.map(({productid,productname,productprice,sellername,image_path})=>(
					<div>
						<div style={{'width':'40%'}}>
							<img src={image_path}/>
						</div>
						<div style={{'width':'60%'}}>
							<div style={{'width':'100%'}}>
								<Link to={"/productdisplay/"+productid} key={productid}><h4>{productname}</h4></Link>
							</div>
							<div style={{'width':'100%'}}>
								{sellername}
							</div><br/>
							<div style={{'width':'100%'}}>
								{productprice}
							</div>
						</div>
					</div>
				))}
			</div>
		</div>
	);
}

export default Product;
